('article_0d6wechh7itwae6kou2egbzuwttqnb','二叉树，看完这篇文就能明白','我们都知道树是自然里的植物，而在数据结构中，二叉树是n(n>=0)个结点的有限集合，该集合或者为空集（称为空二叉树），或者由一个根结点和两棵互不相交的、分别称为根结点的左子树和右子树组成。','树、二叉树','https://edu-online-james.oss-cn-beijing.aliyuncs.com/image/2023/09/13/eebc1d2f0c194e1eb58ddf9f6abf7f22binary.png','no','student_053quw8mbyv5a2q6hehvvtftidykt6','2023-09-13 09:59:37','计算机',1,0,0,0,0,'二叉树特点\n由二叉树定义以及图示分析得出二叉树有以下特点：\n每个结点最多有两颗子树，所以二叉树中不存在度大于2的结点。\n左子树和右子树是有顺序的，次序不能任意颠倒。\n即使树中某结点只有一棵子树，也要区分它是左子树还是右子树。\n二叉树性质\n由二叉树定义以及图示分析得出二叉树有以下性质：\n若对含 n 个结点的完全二叉树从上到下且从左至右进行 1 至 n 的编号，则对完全二叉树中任意一个编号为 i 的结点有如下特性：\n若 i=1，则该结点是二叉树的根，无双亲, 否则，编号为 [i/2] 的结点为其双亲结点;\n若 2i>n，则该结点无左孩子， 否则，编号为 2i 的结点为其左孩子结点；\n若 2i+1>n，则该结点无右孩子结点， 否则，编号为2i+1 的结点为其右孩子结点。'),
('article_4kco8lisarlr2w3c9tkyzic0jav6bv','一文读懂神经网络','神经网络','神经网络','','no','teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-12 16:10:23','计算机',0,2,0,0,0,'一、什么是神经网络？\n相信大家在各种教程都能看的上面的神经网络，这是一个最简单的网络或者说是感知机，X输入，红色的input layer是输入层，hidden layer是隐藏层，output layer是输出层。神经网络是有多个隐藏层，也就是多层感知机（MLP）。\n\n输入层： 输入我们要进行分类或者回归的数据集。\n隐藏层： 把非线性数据处理成线性可分的数据，激活函数在此计算激活。\n输出层： 输出分类结果，是一个线性分类器（SVM、softmax等）\n\n二、前向传播\n① 输入层------>隐含层\n如图，我们人眼一眼就能看到这是一只猫，但计算机不能，计算机是通过把这张图（800*600像素，彩色RGB三通道）看成一个多维数组。\n\nRGB三个通道，每一个通道都是一个二维矩阵，矩阵中的值是它的像素，像素值是[0,255]的256个值，因为计算机用8个比特来存储一个像素值（一个比特就是0或者1的数），2的8次方就是256个数。每一张彩色图片就是由RGB这3个通道的二维矩阵构成的多维数组。\n\n一张图片计算机可以看到很多个特征，如第一幅图的x1，x2，x3都是特征。\n\n以本文第一张图为例，x1，x2，x3通过输入层，乘以不同的权重w1，w2，w3加上一个偏置项。（上图的猫的权重w有800 * 600 * 3=1440000个）\n通过计算f（x，W） = Wx + b后的值，然后传到激活函数得到激活值再传到下一个神经元。\n\n① 输出层------>隐含层\n算出每个loss损失函数后，我们把每个神经元算出的损失（误差）加起来得到总损失（误差）。然后对自己求导得到1（任何函数对其自身求导 =1 ）。我们想知道权重参数w4，w5，w6，w7对整体误差产生了多少影响，可以用整体误差分别对w4，w5，w6，w7求偏导求出（链式法则），求出后更新的权重w4’,w5’,w6’,w7’用这条公式计算比如计算w1’：w1’ = w1 - η*（总体误差对w1的导数），这里的η是学习率。\n\n② 隐藏层------>输入层\n我们想知道权重参数w1，w2，w3对整体误差产生了多少影响，可以用整体误差对w1，w2，w3求偏导求出后更新。（同理链式法则）\n'),
('article_8feoutdx6q2pzp9xi41xegzzan8rs6','cs4','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',4,0,0,0,0,'this is article4'),
('article_e3mni95onbf79w9vhoskyl1d5tj9na','cs8','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',8,0,0,0,0,'this is article8'),
('article_e746fsp8yzg2ngetzvlinp5ti1hgqk','cs6','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',6,0,0,0,0,'this is article6'),
('article_f49oabgugq6yfcij9hasnsz8uj8dpm','一文看懂决策树','决策树','决策树','','no','teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-12 15:58:39','计算机',3,0,0,0,0,'\n决策树介绍\n决策树是一个预测模型，它代表的是对象属性与对象值之间的一种映射关系。树中每个节点表示某个对象，而每个分叉路径则代表某个可能的属性值，而每个叶节点则对应从根节点到该叶节点所经历的路径所表示的对象的值。\n从数据产生决策树的机器学习技术叫做决策树学习，通俗说就是决策树。\n一个决策树包含三种类型的节点：\n决策节点：通常用矩形框来表示\n机会节点：通常用圆圈来表示\n终结节点：通常用三角形来表示\n\n决策树是一树状结构，它的每一个叶节点对应着一个分类，非叶节点对应着在某个属性上的划分，根据样本在该属性上的不同取值将其划分成若干个子集。对于非纯的叶节点，多数类的标号给出到达这个节点的样本所属的类。构造决策树的核心问题是在每一步如何选择适当的属性对样本做拆分。对一个分类问题，从已知类标记的训练样本中学习并构造出决策树是一个自上而下，分而治之的过程。\n决策树的划分依据是信息增益：\n所谓的信息增益是指特征A对训练数据集D的信息增益g（D,A）定义为集合D的信息熵H(D)与特征A给定条件下D的信息条件熵H(D|A)之差\n决策树的优缺点\n优点：\n简单的理解和解释，树木可以可视化；\n需要很少的数据准备，其他技术通常需要归一化。\n缺点：\n决策树学习者可以创建不能很好的推广数据的过于复杂的数，因为会产生过拟合。\n改进：\n随机森林'),
('article_fskvjwoek8gzvjj0fuvi53m6xyb6p7','cs2','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',2,0,0,0,0,'this is article2'),
('article_k5g4gvctxyy6r23fj2fbe7rhw0yyja','提高学习成绩的8个方法','学习经验','学习经验','','no','teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-12 15:53:40','学习经验',5,3,0,0,0,'每个孩子都是一颗花的种子，只不过每个人的花期不同。有的花，一开始就会很灿烂地绽放，有的花，需要漫长的等待。不要看着别人怒放了，自己的那颗还没动静就着急，相信是花，都有自己的花期。细心地，呵护自己的花，慢慢地看着长大，陪着他沐浴阳光风雨，这何尝不是一种幸福。也许你的种子永远不会开花，因为他是参天大树！\n1. 培养好的学习习惯，比只提供物质条件更重要\n即使父母给孩子提供再丰富、便利的物质条件，但若父母疏于陪伴，尤其是在孩子学龄初期(小学1、2年纪)未能帮孩子建立好的学习习惯，那么孩子的学习成绩将普遍低于拥有好的学习习惯的孩子。\n2. 让孩子独立写作业，除非他开口请你帮忙\n陪伴孩子写作业到底有没有必要?有必要，但有技巧。最好是孩子写作业的时候，父母可以同时拿一份报纸，或者一本书，坐在孩子旁边，保持一定距离。当孩子遇到问题时候，再过来辅导孩子。\n辅导时的态度也很重要。首先鼓励孩子：要不你再试试，我相信你。当孩子尝试无果，切不可因此骂孩子“笨”。如果孩子这会儿就有你现在这么“聪明”，那才是怪事。最好保证情绪的平和，对孩子做的好的方面予以表扬，然后用关键点提示的办法，帮孩子找到问题的线索，但由孩子自己动手去做。\n3. 父母要做好榜样\n父母对孩子的影响不是取决于父母怎么做怎么说，而是取决于父母是什么样的人。父母是孩子人生中最重要的第一导师，他们的生活态度会在潜移默化中慢慢影响孩子。很多父母自己天天看电视打麻将却要求孩子努力学习，孩子对电视、麻将的兴趣肯定会比对书本的兴趣大。因此，父母想要孩子成为爱好学习的人，最好的办法应该是自己先成为爱学习的人。\n4. 不断鼓励和启发孩子\n不是所有的孩子在学校里都能获得老师的重视，因此，父母必须无条件地鼓励并启发你的孩子。孩子在学习上的进步，80%归功于父母的鼓励和启发。比如，你的孩子要研究昆虫，你就带他去外面观察蚂蚁;如果你的孩子要研究外星人，和他一起看《E.T.》。\n5. 坚持亲子阅读\n孩子7岁左右若能有良好的阅读习惯，通常他就能拥有较高的智商。孩子在小学低年级时最重要的一项技能就是阅读能力。坚持让孩子每天给你朗读10分钟，你再给孩子朗读10分钟，形成习惯，就算有一天你的孩子阅读能力已经很好了，最好也坚持下去。\n6. 不要把你的孩子和别人家孩子比\n每个孩子的天赋和兴趣都不一样，有的显示出某方面的禀赋早一些，有的可能晚一些。家长不必整天盯着别人家的孩子，看人家看什么学什么，然后回家就逼自己的孩子。真正能让孩子在未来取得成就的是他们的创造力、自控力、自我激励、和“偶尔眼里放出的光芒”。\n7. 陪孩子找到自己的真正兴趣所在\n你不能让孩子整天抱着书本学习，也要帮助孩子发展一些课外兴趣。太多的课外兴趣肯定会影响孩子学习，一个也没有，对孩子的身心发展也不利。帮助孩子找到适合自己的兴趣爱好，是父母的责任。\n切记，别以你自己的目光为孩子选兴趣班。尊重孩子的意愿。而且，选了兴趣班，也需要允许孩子中途放弃。这是他的权力。父母唯一要做的，是多为孩子提供体验的机会，孩子总会在诸多体验中，发现自己最喜欢的。\n8. 让孩子好好睡觉\n孩子的睡眠质量和他的行为方式有直接联系。晚上少睡一小时就能降低孩子的智商。各种电子设备和各种媒体形态的繁荣让现代人睡觉时间越来越少了，孩子的睡觉时间也因此受到影响。现在的孩子比十年前的孩子的睡眠时间少了整整一个小时。孩子在5岁时候，每天需要11小时睡眠，7岁需要10.5小时，9岁需要10小时，11岁需要9.5小时，14岁需要9小时。'),
('article_mps75uavtwkhivm4hdadwpyd79mnqz','cs5','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',5,0,0,0,0,'this is article5'),
('article_n74rr9yayxsua3jnw5l5jejlkhohys','cs1','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',1,0,0,0,0,'this is article1'),
('article_o7sicn2uvc80kje11ist4ebgcw3sqb','cs7','King Lebron James','Lebron James','https://ts1.cn.mm.bing.net/th/id/R-C.1bd4619895b23e93c14ead740b9524ec?rik=IoGxECWc4wUyLA&riu=http%3a%2f%2f5b0988e595225.cdn.sohucs.com%2fimages%2f20181216%2f5ac69ccd7a5747c3896f3f6d08eebb88.jpeg&ehk=%2bRuckXoyVFZA0NqvaFYN4N83C9u%2bvU5PsizwK1It2Eg%3d&risl=&pid=ImgRaw&r=0',NULL,'teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-13 17:06:32','cs',7,0,0,0,0,'this is article7'),
('article_olsdwku0xzzb8ysys6hb24heb27ggh','手把手编写第一个JAVA代码','JAVA程序编写','JAVA','','no','teacher_0czha2qmh26kn0ggqzlvhyhvq6ne6g','2023-09-12 16:08:04','计算机',6,5,0,0,0,'一个 Java 程序可以认为是一系列对象的集合，而这些对象通过调用彼此的方法来协同工作。下面简要介绍下类、对象、方法和实例变量的概念。\n对象：对象是类的一个实例，有状态和行为。例如，一条狗是一个对象，它的状态有：颜色、名字、品种；行为有：摇尾巴、叫、吃等。\n类：类是一个模板，它描述一类对象的行为和状态。\n方法：方法就是行为，一个类可以有很多方法。逻辑运算、数据修改以及所有动作都是在方法中完成的。\n实例变量：每个对象都有独特的实例变量，对象的状态由这些实例变量的值决定\n\n第一个Java程序\n下面看一个简单的 Java 程序，它将输出字符串 Hello World\n\n实例\npublic class HelloWorld { /* 第一个Java程序 * 它将输出字符串 Hello World */ public static void main(String[] args) { System.out.println(\"Hello World\"); // 输出 Hello World } }\n下面将逐步介绍如何保存、编译以及运行这个程序：\n打开代码编辑器，把上面的代码添加进去；\n把文件名保存为：HelloWorld.java；\n打开 cmd 命令窗口，进入目标文件所在的位置，假设是 C:\\\n在命令行窗口输入 javac HelloWorld.java 按下回车键编译代码。如果代码没有错误，cmd 命令提示符会进入下一行（假设环境变量都设置好了）。\n再键输入 java HelloWorld 按下回车键就可以运行程序了\n你将会在窗口看到 Hello World\n$ javac HelloWorld.java\n$ java HelloWorld \nHello World\n如果遇到编码问题，我们可以使用 -encoding 选项设置 utf-8 来编译：\njavac -encoding UTF-8 HelloWorld.java \njava HelloWorld \n'),
