insert  into `course_info`(`id`,`course_id`,`video_link`,`info_link`,`is_delete`,`content`,`chapter_num`,`intro`,`title`) values 
('1701583430027862017','course_gi1uza07p6lxs3bqrgdq7y3k6yk5dl','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/22cb7c2b5f2742c09640d3e643f62f032023-09-12 20-42-26.mp4','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/93b1f54b9a364ce3b2acbfabdf34e7a3OPERATING_SYSTEM_CONCEPTS___The_Little_Book_of_Semaphores.pdf',0,'进程是一个在内存中运行的应用程序。线程是进程中的一个执行任务（控制单元），负责当前进程中程序的执行。一个进程至少有一个线程，一个进程可以运行多个线程，多个线程可共享数据。\r\n进程与线程的区别总结\r\n线程具有许多传统进程所具有的特征，故又称为轻型进程(Light—Weight Process)或进程元；而把传统的进程称为重型进程(Heavy—Weight Process)，它相当于只有一个线程的任务。在引入了线程的操作系统中，通常一个进程都有若干个线程，至少包含一个线程。\\n根本区别：进程是操作系统资源分配的基本单位，而线程是处理器任务调度和执行的基本单位\r\n\r\n资源开销：每个进程都有独立的代码和数据空间（程序上下文），程序之间的切换会有较大的开销；线程可以看做轻量级的进程，同一类线程共享代码和数据空间，每个线程都有自己独立的运行栈和程序计数器（PC），线程之间切换的开销小。\r\n\r\n包含关系：如果一个进程内有多个线程，则执行过程不是一条线的，而是多条线（线程）共同完成的；线程是进程的一部分，所以线程也被称为轻权进程或者轻量级进程。\r\n\r\n内存分配：同一进程的线程共享本进程的地址空间和资源，而进程之间的地址空间和资源是相互独立的\r\n\r\n影响关系：一个进程崩溃后，在保护模式下不会对其他进程产生影响，但是一个线程崩溃整个进程都死掉。所以多进程要比多线程健壮。\r\n执行过程：每个独立的进程有程序运行的入口、顺序执行序列和程序出口。但是线程不能独立执行，必须依存在应用程序中，由应用程序提供多个线程执行控制，两者均可并发执行.\r\n\r\n',1,'本章介绍了操作系统中进程与线程的基本概念。','进程与线程'),
('1701584546224431105','course_gi1uza07p6lxs3bqrgdq7y3k6yk5dl','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/9f23ffb59dc8462992f74bf263f75204deadlock.mp4','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/278601ef5ef745aa9ff193d73216680fOPERATING_SYSTEM_CONCEPTS___The_Little_Book_of_Semaphores.pdf',0,'死锁产生的原因：竞争资源、进程间推进顺序非法。\n死锁产生的4个必要条件：互斥条件、请求和保持条件、不剥夺条件、环路等待条件\n解决死锁的基本方法：预防死锁、避免死锁、检测死锁、解除死锁',2,'所谓死锁，是指多个进程在运行过程中因争夺资源而造成的一种僵局，当进程处于这种僵持状态时，若无外力作用，它们都将无法再向前推进。','死锁'),
('1701586601483722754','course_0tazw5ttuv1ky86aiwsswcly1wcpfh','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/82d508723a264c11ae01e4c6099ac3e8dp.mp4','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/ac562cebe94c43b893dd4e6b89ba9321suanfa.cpp',0,'动态规划的核心思想：\n无后效性：一旦f(n)确定，“我们如何凑出f(n)”就再也用不着了。要求出f(15)，只需要知道f(14),f(10),f(4)的值，而f(14),f(10),f(4)是如何算出来的，对之后的问题没有影响，这就是无后效性。\n最优子结构：大问题的最优解可以由小问题的最优解推出，这个性质叫做“最优子结构性质”。\n\n',1,'动态规划，即求出f(n)，只需要知道几个更小的f(c)。我们将求解f(c)称作求解f(n)的“子问题”。我们只需将一个问题拆成几个子问题，分别求解这些子问题，即可推断出大问题的解。','动态规划'),
('1701587304931418113','course_0tazw5ttuv1ky86aiwsswcly1wcpfh','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/bac6fda549a14dccbae798b67a7f342b递归.mp4','https://edu-online-james.oss-cn-beijing.aliyuncs.com/material/2023/09/12/fd8b4f458f21489a96b9185a69c24932suanfa.cpp',0,'学习什么时候及如何使用递归，具有以下特征的问题可考虑递归求解：\n当问题和子问题具有递推关系，比如杨辉三角、计算阶乘（后文讨论）。\n具有递归性质的数据结构，比如链表、树、图。\n反向性问题，比如取反。',2,'本章将介绍递归：简单说程序调用自身的编程技巧叫递归。递归的思想是把一个大型复杂问题层层转化为一个与原问题规模更小的问题，问题被拆解成子问题后，递归调用继续进行，直到子问题无需进一步递归就可以解决的地步为止。','递归'),
